import Home from "./pages/home/Home";
import{
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

function App(){
  return(
    <BrowserRouter>
     <Routes>
      <Route path="/" element={<Home/>}></Route>
      <Home/>
     </Routes>
     </BrowserRouter>
  );
}
export default App;
